  return (
    <>
      <NavBar />
      <div className="container">
        <h1 className="text-primary py-3">Dashboard de Vendas</h1>

        <div className="row px-3">
          <BarChart />
        </div>
        <DataTable />
      </div>
      <Footer />
    </>
  );
}

export default App;
